import React, { useEffect } from 'react'
import { useDispatch, useSelector } from 'react-redux'
import { useCallback } from 'react'
import { useNavigate } from 'react-router-dom'
import { likeList } from '../store/actions/likeProducts'
import Header from '../components/Header'
import Footer from '../components/Footer'


export default function LikeProducts() {

  const dispatch = useDispatch()
  const likes = useSelector((state) => state.likes.likes)
  const likeProduct = useSelector((state) => state.likes.likeProducts)
  const navigate = useNavigate()



  console.log(likes)

  useEffect(() => {

    (async () => {
      await dispatch(likeList())
    })()

  }, [])


  const singleItem = useCallback((item) => {
    navigate(`/home/${item.id}`)
}, [])


  return (

<div>
<Header/>

<div className='cardStyle'>
  {likeProduct.map((item) => (
     <div key={item.id} onClick={() => singleItem(item)} className="card ">
     <img className="card-img-top" src={item.image} alt="Card image cap" />
     <div className="card-body">
       <h5 className="card-title">{item.title}</h5>
       <p className="card-text desc">{item.description}</p>
       <p className="card-text">{item.price + '$'}</p>
       <p className="card-text">
         {item.quantity}
       </p>
     </div>
   </div>
  ))}
</div>


<Footer/>

</div>

  )
}
